DROP TABLE `users`;

CREATE TABLE `users` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `user_name` varchar(255) default NULL,
  `birth_dt` varchar(255),
  `phone_number` varchar(100) default NULL,
  `salary` mediumint default NULL,
  `age` mediumint default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

